            "content": "import { VisArea, VisAxis, VisLine, VisTooltip } from \"@unovis/solid\"\nimport { Area, CurveType, Position } from \"@unovis/ts\"\n\nimport {\n  Card,\n  CardContent,\n  CardDescription,\n  CardFooter,\n  CardHeader,\n  CardTitle,\n} from \"@/registry/ui/card\"\nimport {\n  ChartContainer,\n  ChartCrosshair,\n  ChartTooltipContent,\n  type ChartConfig,\n} from \"@/registry/ui/chart\"\n\ninterface DataRecord {\n  month: string\n  desktop: number\n  mobile: number\n}\n\nconst data: DataRecord[] = [\n  { month: \"January\", desktop: 186, mobile: 80 },\n  { month: \"February\", desktop: 305, mobile: 200 },\n  { month: \"March\", desktop: 237, mobile: 120 },\n  { month: \"April\", desktop: 73, mobile: 190 },\n  { month: \"May\", desktop: 209, mobile: 130 },\n  { month: \"June\", desktop: 214, mobile: 140 },\n]\n\nconst chartConfig = {\n  desktop: {\n    label: \"Desktop\",\n    color: \"var(--chart-1)\",\n  },\n  mobile: {\n    label: \"Mobile\",\n    color: \"var(--chart-2)\",\n  },\n} satisfies ChartConfig\n\nconst AreaChartGradient = () => {\n  return (\n    <Card>\n      <CardHeader>\n        <CardTitle>Area Chart - Gradient</CardTitle>\n        <CardDescription>\n          Showing total visitors for the last 6 months\n        </CardDescription>\n      </CardHeader>\n      <CardContent class=\"\">\n        <ChartContainer\n          config={chartConfig}\n          type=\"xy\"\n          data={data}\n          yDomain={[0, 620]}\n        >\n          <svg height={0} width={0}>\n            <defs>\n              <linearGradient id=\"fillDesktop\" x1=\"0\" y1=\"0\" x2=\"0\" y2=\"1\">\n                <stop\n                  offset=\"5%\"\n                  stop-color=\"var(--color-desktop)\"\n                  stop-opacity={0.8}\n                />\n                <stop\n                  offset=\"95%\"\n                  stop-color=\"var(--color-desktop)\"\n                  stop-opacity={0.1}\n                />\n              </linearGradient>\n              <linearGradient id=\"fillMobile\" x1=\"0\" y1=\"0\" x2=\"0\" y2=\"1\">\n                <stop\n                  offset=\"5%\"\n                  stop-color=\"var(--color-mobile)\"\n                  stop-opacity={0.8}\n                />\n                <stop\n                  offset=\"95%\"\n                  stop-color=\"var(--color-mobile)\"\n                  stop-opacity={0.1}\n                />\n              </linearGradient>\n            </defs>\n          </svg>\n          <VisArea<DataRecord>\n            x={(_, i) => i}\n            y={[(d) => d.mobile, (d) => d.desktop]}\n            color=\"auto\"\n            opacity={0.4}\n            curveType={CurveType.Natural}\n            attributes={{\n              [`${Area.selectors.area}:nth-child(1)`]: {\n                fill: \"url(#fillDesktop)\",\n              },\n              [`${Area.selectors.area}:nth-child(2)`]: {\n                fill: \"url(#fillMobile)\",\n              },\n            }}\n          />\n          <VisLine<DataRecord>\n            x={(_, i) => i}\n            y={[(d) => d.mobile, (d) => d.mobile + d.desktop]}\n            color={[\"var(--color-mobile)\", \"var(--color-desktop)\"]}\n            curveType={CurveType.Natural}\n            lineWidth={1}\n          />\n          <VisAxis<DataRecord>\n            type=\"x\"\n            tickFormat={(d) => data[d as number].month.slice(0, 3)}\n            gridLine={false}\n            tickLine={false}\n            domainLine={false}\n            numTicks={data.length}\n          />\n          <ChartCrosshair<DataRecord>\n            color={[\"var(--color-mobile)\", \"var(--color-desktop)\"]}\n            template={(props) => (\n              <ChartTooltipContent labelKey=\"month\" {...props} />\n            )}\n          />\n          <VisTooltip horizontalPlacement={Position.Center} />\n        </ChartContainer>\n      </CardContent>\n      <CardFooter>\n        <div class=\"flex w-full items-start gap-2 text-sm\">\n          <div class=\"grid gap-2\">\n            <div class=\"flex items-center gap-2 leading-none font-medium\">\n              Trending up by 5.2% this month{\" \"}\n              <svg\n                xmlns=\"http://www.w3.org/2000/svg\"\n                class=\"size-4\"\n                viewBox=\"0 0 24 24\"\n              >\n                <g\n                  fill=\"none\"\n                  stroke=\"currentColor\"\n                  stroke-linecap=\"round\"\n                  stroke-linejoin=\"round\"\n                  stroke-width=\"2\"\n                >\n                  <path d=\"m22 7l-8.5 8.5l-5-5L2 17\" />\n                  <path d=\"M16 7h6v6\" />\n                </g>\n              </svg>\n            </div>\n            <div class=\"text-muted-foreground flex items-center gap-2 leading-none\">\n              January - June 2024\n            </div>\n          </div>\n        </div>\n      </CardFooter>\n    </Card>\n  )\n}\n\nexport default AreaChartGradient\n"
